using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.Configuration;
using Microsoft.VisualBasic;

namespace VirtuaConecta.Outbound.Parametros
{
    public class Parametros
    {

        public static String LocalLogFile()
        {
            var str = ConfigurationManager.AppSettings["Local_arq_log"];
            return str;
        }

        public static Int32 Serie_rps()
        {
            Int32 ret = 1;

            var str = ConfigurationManager.AppSettings["Serie_rps"];

            if (!String.IsNullOrEmpty(str) && Information.IsNumeric(str))
            {
                ret = Convert.ToInt32(str);
            }

            return ret;
        }

        public static String  NrTerminal()
        {
            var str = ConfigurationManager.AppSettings["Terminal"];

            return str;
        }


        public static String Impressora()
        {
            var str = ConfigurationManager.AppSettings["Dados_imprimir"];
       
            return str;
        }

        public static String Cnpj()
        {

            var str = ConfigurationManager.AppSettings["Cnpj_loja"];
            return str;
        }



        public static String PrefixoTel()
        {
            var str = ConfigurationManager.AppSettings["prefixo_tel"];
            return str;
        }
        public static String LocalDbMysql()
        {
            var str = ConfigurationManager.AppSettings["Db_mysql"];
            return str;
        }

        public static String LocalDbSqlite()
        {
            var str = ConfigurationManager.AppSettings["Db_sqlite"];
            return str;
        }

        public static String UrlPlugin()
        {
            var str = ConfigurationManager.AppSettings["Url_base"];
            return str;
        }

        public static String UrlViaCep()
        {
            var str = ConfigurationManager.AppSettings["Url_viacep"];
            return str;
        }

        public static String UrlFeriado()
        {
            var str = ConfigurationManager.AppSettings["Url_feriado"];
            str = str.Replace("|", "&");
            return str;
        }
        public static String UrlFeriadoCodMun()
        {
            var str = ConfigurationManager.AppSettings["Url_feriado_CodMun"];
            str = str.Replace("|", "&");
            return str;
        }

        public static Int32 IndiceFiltro()
        {
            Int32 resp = 1;
            var str = ConfigurationManager.AppSettings["IndiceFiltro"];

            if (Information.IsNumeric(str))
            {
                resp = Convert.ToInt32(str);
            }

            return resp;
        }

        public static String MenusLiberados()
        {
            var str = ConfigurationManager.AppSettings["Menu"];

            if (String.IsNullOrEmpty(str))
            {
                str = "0,0,0";
            }

            return str;
        }

        public static Int32 IntervaloAlerta()
        {
            Int32 resp = 0;
            var str = ConfigurationManager.AppSettings["Alerta_ini"];

            if (Information.IsNumeric(str))
            {
                resp = Convert.ToInt32(str);
            }

            return resp;
        }




        public static String ImagemAberto()
        {
            String img = "";

            return img;

        }

        public static String ImagemFechado()
        {
            String img = "";
            return img;

        }

    }
}
